                                <p><p>　　梦见月亮有晕光茫混沌，是母亲或妻子将有灾难，且烦事重重的凶梦，须要发辉耐心，去突破瓶颈。</p><p>　　<strong>周公股市</strong></p><p>　　梦见月亮有晕光茫混沌，股市暗示上柜市场在高价中盘旋，随后会下跌，欲振乏力。</p></p>
